import React from 'react';
import { Link } from 'react-router-dom'

function Home() {
  return (
 <div>
    <div className="columns">
      <div className="column is-7">
        First column
      </div>
      <div className="column is-5">
                        <td><Link to={`/centers`}>Centros</Link></td>
        <button className='button is-large is-success'> </button>
        <button className='button is-large is-success'>Nivel</button>
        <button className='button is-large is-success'>Recompensas</button>
      </div>
    </div>
 </div>
  );
}

export default Home;
